import React, { FC } from "react";
// import './styles/dashboard.css';
import { lostSectorType } from "../typeDefinitions/lostSectors";

type MyProps = {};

type MyState = {
	apiResponse: lostSectorType;
};

class LostSectorRotation extends React.Component<MyProps, MyState> {
	constructor(props: MyProps) {
		super(props);
		// this.state = { apiResponse: "" };
	}

	getLostSectors() {
		fetch("http://localhost:3000/api/lost_sector")
			.then(res => res.json())
			.then(res => this.setState({ apiResponse: res }));
	}

	componentWillMount() {
		this.getLostSectors();
		console.log("LOST SECTOR", this.state);
	}

	render() {
		if (this.state !== null) {
			return <div>{this.state.apiResponse.currLostSector}</div>;
		}
	}
}

export default LostSectorRotation;
